splitWaves = []

$(document).ready(function(){

  //splite each line into an array of characters
  for(i = 0; i < waves.length; i++){
    var sW = waves[i].split("");
    splitWaves.push(sW);
  }

  //take each character and give it a <span> of a class for whatever the character is
  setTimeout(function(){
    for(j in splitWaves){
      for(k in splitWaves[j]){
        if(splitWaves[j][k] === "O"){
          splitWaves[j][k] = "<span class='waves-O'>O</span>"
        } else if (splitWaves[j][k] === "k"){
          splitWaves[j][k] = "<span class='waves-k'>k</span>"
        } else if (splitWaves[j][k] === "0"){
          splitWaves[j][k] = "<span class='waves-zero'>0</span>"
        } else if (splitWaves[j][k] === "x"){
          splitWaves[j][k] = "<span class='waves-x'>x</span>"
        } else if (splitWaves[j][k] === "d"){
          splitWaves[j][k] = "<span class='waves-d'>d</span>"
        } else if (splitWaves[j][k] === "l"){
          splitWaves[j][k] = "<span class='waves-l'>l</span>"
        } else if (splitWaves[j][k] === "o"){
          splitWaves[j][k] = "<span class='waves-o'>o</span>"
        } else if (splitWaves[j][k] === ":"){
          splitWaves[j][k] = "<span class='waves-colon'>:</span>"
        } else if (splitWaves[j][k] === ";"){
          splitWaves[j][k] = "<span class='waves-semicolon'>;</span>"
        } else if (splitWaves[j][k] === "X"){
          splitWaves[j][k] = "<span class='waves-X'>X</span>"
        } else if (splitWaves[j][k] === "K"){
          splitWaves[j][k] = "<span class='waves-K'>K</span>"
        } else if (splitWaves[j][k] === "W"){
          splitWaves[j][k] = "<span class='waves-W'>W</span>"
        } else if (splitWaves[j][k] === "N"){
          splitWaves[j][k] = "<span class='waves-N'>N</span>"
        } else if (splitWaves[j][k] === "."){
          splitWaves[j][k] = "<span class='waves-period'>.</span>"
        } else if (splitWaves[j][k] === "c"){
          splitWaves[j][k] = "<span class='waves-c'>c</span>"
        }
      }
    }
  }, 500)

  setTimeout(function(){
    for(k in splitWaves){
      splitWaves[k] = splitWaves[k].join("")
    }
  }, 1000)

  setTimeout(function(){
    for (p = 0; p < splitWaves.length; p++){
      var name = "<p class='waveLine' id='wave'"+p+">"+splitWaves[p]+"</p>"
      $("#wavesContainer").append(name)
    }
    $("#fade").fadeOut(2000);
    $("#loading").fadeOut(2000);
  }, 1500)

});

